      REFERENCES empresa (cod_empresa);











COMMIT; 
/* --------------- TABLAS Y LLENADO  ----------------------------------*/

/* ---------------   CASO 1  ----------------------------------*/

SELECT
    p.id_profesional,
    
    p.appaterno || ' ' || p.apmaterno || ', ' || p.nombre AS nombre_completo,

    /* sector 3 */
    COUNT(CASE WHEN e.cod_sector = 3 THEN 1 END) AS asesorias_banca,
    SUM(CASE WHEN e.cod_sector = 3 THEN a.honorario ELSE 0 END) AS honorarios_banca,

    /* sector 4 */
    COUNT(CASE WHEN e.cod_sector = 4 THEN 1 END) AS asesorias_retail,
    SUM(CASE WHEN e.cod_sector = 4 THEN a.honorario ELSE 0 END) AS honorarios_retail,

    /* banca y retail*/
    COUNT(CASE WHEN e.cod_sector IN (3,4) THEN 1 END) AS total_asesorias,
    SUM(CASE WHEN e.cod_sector IN (3,4) THEN a.honorario ELSE 0 END) AS total_honorarios

FROM profesional p
JOIN asesoria a ON p.id_profesional = a.id_profesional
JOIN empresa e  ON a.cod_empresa = e.cod_empresa


WHERE p.id_profesional IN (
        /* banca */
        SELECT id_profesional
        FROM asesoria a JOIN empresa e ON a.cod_empresa = e.cod_empresa
        WHERE e.cod_sector = 3
        GROUP BY id_profesional

        INTERSECT

         /* retail */
        SELECT id_profesional
        FROM asesoria a JOIN empresa e ON a.cod_empresa = e.cod_empresa
        WHERE e.cod_sector = 4
        GROUP BY id_profesional
    )

GROUP BY 
    p.id_profesional, p.appaterno, p.apmaterno, p.nombre

ORDER BY 
    p.id_profesional;




/* ---------------   FIN CASO 1  ----------------------------------*/

/* ---------------   CASO 2  ----------------------------------*/
SELECT
  p.id_profesional,
  p.appaterno || ' ' || p.apmaterno || ', ' || p.nombre AS nombre_completo,
  pr.nombre_profesion,
  c.nom_comuna AS comuna_residencia,
  COUNT(*) AS nro_asesorias,
  ROUND(SUM(a.honorario)) AS monto_total_honorario,
  ROUND(AVG(a.honorario)) AS promedio_honorario,
  ROUND(MIN(a.honorario)) AS honorario_minimo,
  ROUND(MAX(a.honorario)) AS honorario_maximo
FROM profesional p
JOIN profesion pr ON p.cod_profesion = pr.cod_profesion
JOIN comuna c ON p.cod_comuna = c.cod_comuna
JOIN asesoria a ON p.id_profesional = a.id_profesional
WHERE EXTRACT(MONTH FROM a.fin_asesoria) = 4
  AND EXTRACT(YEAR FROM a.fin_asesoria) = EXTRACT(YEAR FROM SYSDATE) - 1
GROUP BY 
  p.id_profesional, p.appaterno, p.apmaterno, p.nombre,
  pr.nombre_profesion, c.nom_comuna
ORDER BY p.id_profesional;




/* ---------------   FIN CASO 2  ----------------------------------*/

/* ---------------   CASO 3  ----------------------------------*/
/* Antes */
SELECT
  ROUND(SUM(a.honorario)) AS HONORARIO,
  p.id_profesional,
  (p.numrun_prof || p.dvrun_prof) AS NUMRUN_PROF,
  p.sueldo AS SUELDO
FROM profesional p
JOIN asesoria a 
  ON p.id_profesional = a.id_profesional
WHERE EXTRACT(MONTH FROM a.fin_asesoria) = 3
  AND EXTRACT(YEAR  FROM a.fin_asesoria) = EXTRACT(YEAR FROM SYSDATE) - 1
GROUP BY
  p.id_profesional,
  p.numrun_prof, p.dvrun_prof,
  p.appaterno, p.apmaterno, p.nombre, p.sueldo
ORDER BY p.id_profesional;


/* Despues */
SELECT
  ROUND(SUM(a.honorario)) AS HONORARIO,
  p.id_profesional,
  (p.numrun_prof || p.dvrun_prof) AS NUMRUN_PROF,
  
  CASE
     WHEN ROUND(SUM(a.honorario)) < 1000000 
         THEN ROUND(p.sueldo * 1.10)
     ELSE ROUND(p.sueldo * 1.15)
  END AS SUELDO
FROM profesional p
JOIN asesoria a 
  ON p.id_profesional = a.id_profesional
WHERE EXTRACT(MONTH FROM a.fin_asesoria) = 3
  AND EXTRACT(YEAR  FROM a.fin_asesoria) = EXTRACT(YEAR FROM SYSDATE) - 1
GROUP BY
  p.id_profesional,
  p.numrun_prof, p.dvrun_prof,
  p.appaterno, p.apmaterno, p.nombre, p.sueldo
ORDER BY p.id_profesional;

/* ---------------   FIN CASO 3  ----------------------------------*/
